import React from  'react';

function Loginsignup() {
    const [signin] = React.useState(true);
    return(
        <div className="container">
            <div className="SignUpContainer">   
                <div className="form">
                    <div className="title">Create Account</div>
                    <div className="input" type='text' aria-placeholder='Name'></div>
                    <div className="input" type='email' aria-placeholder='Email'></div>
                    <div className="input" type='password' aria-placeholder='Password'></div>
                    <div className="button">Sign up</div>
                </div>
            </div>
        </div>
    )
}
